import React from "react";

function Nav() {
  return (
    <Nav defaultActiveKey="/about" as="ul">
  <Nav.Item as="li">
    <Nav.Link href="/about">About</Nav.Link>
  </Nav.Item>
  <Nav.Item as="li">
    <Nav.Link eventKey="link-1">Portfolio</Nav.Link>
  </Nav.Item>
  <Nav.Item as="li">
    <Nav.Link eventKey="link-2">Contact</Nav.Link>
  </Nav.Item>
</Nav>
  );
}

export default Nav;
